import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
// import { actionExpense, actionFetchCurrencies } from '../actions';

class FormResults extends React.Component {
  render() {
    const { walletExpenses } = this.props;
    console.log(walletExpenses);
    return (
      <form className="formExpensesContainer">
        <div>
          <p>Despesas</p>
          {
            walletExpenses.map((item, index) => (
              <div key={ index }>
                <p>
                  Id:
                  { item.id }
                </p>
                <p>
                  Descrição:
                  { item.description }
                </p>
                <p>
                  Tipo de Despesa:
                  { item.tag }
                </p>
                <p>
                  Método de pagamento:
                  { item.method }
                </p>
                <p>
                  Moeda:
                  { item.currency }
                </p>
                <p>
                  Valor:
                  { item.value }
                </p>
                <hr />
              </div>
            ))
          }
        </div>
      </form>
    );
  }
}

FormResults.propTypes = {
  walletExpenses: PropTypes.array,
}.isRequired;

const mapStateToProps = (state) => ({
  walletExpenses: state.wallet.expenses,
});

/*
const mapDispatchToProps = (dispatch) => ({
  walletExpenses: (state) => dispatch(actionExpense(state)),
  currenciesGlobal: () => dispatch(actionFetchCurrencies()),
});
*/

export default connect(mapStateToProps)(FormResults);
